import React, { Component } from 'react';
import About from './about';
import HomePage from './homepage';
import Contact from './contact';
import {Link} from 'react-scroll';
import './navstyle.css';
import $ from 'jquery';

class Nav extends Component {

  componentDidMount = () => {
    $(document).ready(function() {
      $(window).scroll(function() {
        if ($(document).scrollTop() > 400) {
          console.log('hello');
          $(".nav").addClass("test");
        } else {
           $(".nav").removeClass("test");
    }
    });
  });
    }

  render(){
   return (
      <div className='nav'>
      <div className='blck'>
        <p style={{marginLeft:30,fontSize:30,marginTop:-10,fontFamily:'Joti One'}}>ANJALI</p>
      </div>
       <Link
          style={{marginLeft:700}}
          activeClass="active"
          to="homepage"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Home</span></Link>
       <Link
          style={{marginLeft:30}}
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
      ><span className='heading'>About</span></Link>
        <Link
          style={{marginLeft:30}}
          activeClass="active"
          to="resume"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Resume</span></Link>
        <Link
          style={{marginLeft:30}}
          activeClass="active"
          to="portfolio"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Portfolio</span></Link>
        <Link
          style={{marginLeft:30}}
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Contact</span></Link>
  </div>
    );
  }
}

export default Nav;
